import ReactDOM from 'react-dom/client';
import App from './App';
ReactDOM.render(
<App
    text={`Focused, hard work is the real key
      to success. Keep your eyes on the goal, 
      and just keep taking the next step 
      towards completing it.`}
    maxLength={35}
  />,
)
root.render(element);
